import React from "react";
import { NavLink } from 'react-router-dom'
import s from '../style/Page404.module.css'

export default class Page404 extends React.Component {
    render() {
        return (
            <div>
                <h1 className={s.titulo}>ERROR 404: Page not found</h1>
                <div style="width:100%;height:0;padding-bottom:84%;position:relative;"><iframe src="https://giphy.com/embed/H54feNXf6i4eAQubud" width="100%" height="100%" style="position:absolute" frameBorder="0" class="giphy-embed" allowFullScreen></iframe></div><p><a href="https://giphy.com/gifs/chicken-bro-H54feNXf6i4eAQubud">via GIPHY</a></p>'
                <h2 className={s.pregunta}>Â¿Volver a Home?</h2>
                <div className={s.mini_box}>
                    <div>
                    <NavLink to={'/home'} className={s.nav}><span className={s.opcion}>SI</span></NavLink>
                    </div>
                    <div>
                    <NavLink to={'/'} className={s.nav}><span className={s.opcion}>NO</span></NavLink>
                    </div>
                </div>

            </div>
        )

    }
}
